import React from 'react';
import './TextInput.css'

class TextInput extends React.Component {
    state = {
        text: "",
    };
    render() {
        return (
            <input onChange={(val) => this.setState()} type='text' id={this.props.id} placeholder={this.props.ph} style={{marginTop: this.props.top}}></input>
        )
    }
};

export default TextInput;
